import { SendbirdApp, ChannelList, ChannelListHeader } from '@sendbird/uikit';
import '@sendbird/uikit/dist/index.css';

export default function App({ channel }) {
  const renderCustomHeader = () => {
    // Custom header implementation
    return (
      <div>
        <h2>Custom Header</h2>
        {/* Add any other custom content */}
      </div>
    );
  };

  return (
    <div className="App" style={{ height: 600 }}>
      <SendbirdApp
        appId={process.env.REACT_APP_SENDBIRD_APP_API_KEY}
        userId="john"
        theme="dark"
        renderChannelListHeader={() => (
          <ChannelListHeader
            renderHeader={renderCustomHeader}
            renderIconButton={null} // Set to null to hide the IconButton
            allowProfileEdit={true} // Optionally set allowProfileEdit
          />
        )}
      >
        <ChannelList
          // Add any other ChannelList props if needed
        />
      </SendbirdApp>
    </div>
  );
}
